const { number } = require('format-message');
const formatMessage = require('format-message');
const ArgumentType = require('../../extension-support/argument-type');
const BlockType = require('../../extension-support/block-type');
const Cast = require('../../util/cast');
const fetchWithTimeout = require('../../util/fetch-with-timeout');
const log = require('../../util/log');

const serverTimeoutMs = 10000; // 10 seconds (chosen arbitrarily).
var connectionIsValid = false;


/**
 * Icon svg to be displayed at the left edge of each extension block, encoded as a data URI.
 * @type {string}
 */
// eslint-disable-next-line max-len
const blockIconURI = 'data:image/png;base64,';

/**
 * Class for the makey makey blocks in Scratch 3.0
 * @constructor
 */
class Scratch3SpotBlocks {
    constructor (runtime) {
        /**
         * The runtime instantiating this block package.
         * @type {Runtime}
         */
        this.runtime = runtime;

        /**
         * A toggle that alternates true and false each frame, so that an
         * edge-triggered hat can trigger on every other frame.
         * @type {boolean}
         */
/*        this.frameToggle = false;

        // Set an interval that toggles the frameToggle every frame.
        setInterval(() => {
            this.frameToggle = !this.frameToggle;
        }, this.runtime.currentStepTime);

        this.keyPressed = this.keyPressed.bind(this);
        this.runtime.on('KEY_PRESSED', this.keyPressed);

        this._clearkeyPressBuffer = this._clearkeyPressBuffer.bind(this);
//        this.runtime.on('PROJECT_STOP_ALL', this._clearkeyPressBuffer);
*/
    }

    /**
     * @returns {object} metadata for this extension and its blocks.
     */
    getInfo () {
        return {
            id: 'spot',
            name: 'Spot',
            blockIconURI: blockIconURI,
            blocks: [
                {
                    opcode: 'connectRobot',
                    text: formatMessage({
                        id: 'connectRobot',
                        default: 'connect to Spot',
                        description: 'Connect to Spot'
                    }),
                    blockType: BlockType.COMMAND,
                    
                },
               {
                    opcode: 'stand',
                    text: formatMessage({
                        id: 'stand',
                        default: 'stand',
                        description: 'Tell Spot to stand'
                    }),
                    blockType: BlockType.COMMAND,
                   
                },{
                    opcode: 'sit',
                    text: formatMessage({
                        id: 'sit',
                        default: 'sit',
                        description: 'Sit'
                    }),
                    blockType: BlockType.COMMAND,
                   
                }, {
                    opcode: 'turnRight',
                    text: formatMessage({
                        id: 'turnRight',
                        default: 'turn right [degrees] degrees',
                        description: 'Turn Right'
                    }),
                    blockType: BlockType.COMMAND,
                    arguments: {
                        degrees: {
                            type: "number",
                            defaultValue: 90
                        }
                    }
                   
                },
                     {
                    opcode: 'turnLeft',
                    text: formatMessage({
                        id: 'turnLeft',
                        default: 'turn left [degrees] degrees',
                        description: 'Turn Left'
                    }),
                    blockType: BlockType.COMMAND,
                    arguments: {
                        degrees: {
                            type: "number",
                            defaultValue: 90
                        }
                    }
                   
                },
                     {
                         opcode: 'forward',
                         text: formatMessage({
                             id: 'forward',
                             default: 'move forward [distance]',
                             description: 'Move Forward'
                         }),
                         blockType: BlockType.COMMAND,
                         arguments: {
                             distance: {
                                 type: "number",
                                 defaultValue: 1
                             }
                         }
                        
                     },
                      {
                         opcode: 'backward',
                         text: formatMessage({
                             id: 'backward',
                             default: 'move backward [distance]',
                             description: 'Move Backward'
                         }),
                         blockType: BlockType.COMMAND,
                         arguments: {
                             distance: {
                                 type: "number",
                                 defaultValue: 1
                             }
                         }
                        
                     },
                     {
                        opcode: 'moveLeft',
                        text: formatMessage({
                            id: 'moveLeft',
                            default: 'move left [distance]',
                            description: 'move left'
                        }),
                        blockType: BlockType.COMMAND,
                        arguments: {
                            distance: {
                                type: "number",
                                defaultValue: 1
                            }
                        }
                       
                    },
                    {
                        opcode: 'moveRight',
                        text: formatMessage({
                            id: 'moveRight',
                            default: 'move right [distance]',
                            description: 'move right'
                        }),
                        blockType: BlockType.COMMAND,
                        arguments: {
                            distance: {
                                type: "number",
                                defaultValue: 1
                            }
                        }
                       
                    },
                    {
                        opcode: 'moveBody',
                        text: formatMessage({
                            id: 'moveBody',
                            default: 'move forward:[x] sideways:[y] turn:[z] degrees',
                            description: 'Move Body'
                        }),
                        blockType: BlockType.COMMAND,
                        arguments: {
                            "x": {
                                type: "number",
                                defaultValue: "1"
                            },
                            "y": {
                                type: "number",
                                defaultValue: "0"
                            },
                            "z": {
                                type: "number",
                                defaultValue: "0"
                            }
                        }
                       
                    },
                    {
                        opcode: 'rotateBody',
                        text: formatMessage({
                            id: 'rotateBody',
                            default: 'rotate pitch:[pitch] yaw:[yaw] roll:[roll] degrees',
                            description: 'Rotate Body'
                        }),
                        blockType: BlockType.COMMAND,
                        arguments: {
                            "pitch": {
                                type: "number",
                                defaultValue: "0"
                            },
                            "yaw": {
                                type: "number",
                                defaultValue: "0"
                            },
                            "roll": {
                                type: "number",
                                defaultValue: "0"
                            }
                        }
                       
                    },
            ]
        };
    }

    connectRobot(args) {
        this._makeRequest("connectRobot").then() 
        {
            return;
        }
    }

    stand (args)
    {
        
        this._makeRequest("stand").then()
        {
            return;
        }
    }
    sit (args)
    {
        
        this._makeRequest("sit").then()
        {
            return;
        }
    }
        
       turnRight (args)
       {
           const cmdArgs = {
            x: 0,
            y: 0,
            z: args.degrees * -1
           };
           this._makeRequest("move", args=cmdArgs).then()
           {
               return;
           }
       }
    
    
       turnLeft (args)
       {
           const cmdArgs = {
            x: 0,
            y: 0,
            z: args.degrees
           };
           this._makeRequest("move", args=cmdArgs).then()
           {
               return;
           }
       }

    forward (args)
    {
        const cmdArgs = {
            x: args.distance,
            y: 0,
            z: 0
        }
        this._makeRequest("move", args=cmdArgs).then()
        {
        return;
        }
    }
    
    backward (args)
    {
        const cmdArgs = {
            x: args.distance * -1,
            y: 0,
            z: 0
        }
        this._makeRequest("move", args=cmdArgs).then()
        {
        return;
        }
    }

    moveRight(args) {
        const cmdArgs = {
            x: 0,
            y: args.distance,
            z: 0
        };
        this._makeRequest("move", args=cmdArgs).then()
        {
            return;
        }
    }

    moveLeft(args) {
        const cmdArgs = {
            x: 0,
            y: args.distance * -1,
            z: 0
        };
        this._makeRequest("move", args=cmdArgs).then()
        {
            return;
        }
    }

    moveBody(args) {
        const cmdArgs = args;
        this._makeRequest("move", args=args).then()
        {
            return;
        }
    }

    rotateBody(args) {
        const cmdArgs = args;
        this._makeRequest("rotate", args=args).then()
        {
            return;
        }
    }
    
    _makeRequest(commandName, args = {})
    {
        
        let method = commandName == "connectRobot" ? "GET" : "POST";
        let body = commandName == "connectRobot" ? null : JSON.stringify({
            Command: commandName,
            Args: args
        })
        if (commandName != "connectRobot" && !connectionIsValid) {
            return new Promise(()=>{});
        }

        const url = "http://192.168.4.55:8000/command";

        $.ajax({
            type: method,
            url: url,
            data: body,
            success: function (response) {
                if (commandName == "connectRobot") {
                    const valid = response['connection_valid'];
                    if (!valid) 
                        alert("You do not have access to Spot!");
                    connectionIsValid = valid
                    sessionStorage.setItem("cc-robot-connected", valid);
                }
                
            },
            error: function (response) {
                log.warn(`error sending command to the robot ${response} `);
            },
        });

        return new Promise(resolve => setTimeout(resolve, 1000));
    }
}
module.exports = Scratch3SpotBlocks;
